e9\u05dc \u05e0\u05ea\u05df \u05d2\u05d5\u05e9\u05df , \u05d4\u05d7\u05dc\u05d8\u05ea\u05d9 \u05e9\u05d0\u05d5\u05ea\u05d5 \u05d0\u05e7\u05dc\u05d9\u05d8 , \u05de\u05de\u05e9 \u05d0\u05d4\u05d1\u05ea\u05d9 \u05d0\u05d5\u05ea\u05d5 . \n\u05dc\u05d0 \u05d4\u05e2\u05dc\u05ea\u05d9 \u05e2\u05dc \u05d3\u05e2\u05ea\u05d9 \u05d0\u05e4\u05d9\u05dc\u05d5 \u05dc\u05e8\u05d2\u05e2 \u05e9\u05d6\u05d4 \u05d9\u05e7\u05d3\u05dd \u05d0\u05d5\u05ea\u05d9 \u05db\u05dc \u05db\u05da .\n\u05e1\u05da \u05d4\u05db\u05dc \u05d4\u05d9\u05d9\u05ea\u05d9 \u05d9\u05dc\u05d3 \u05d1\u05df 18 \u05e2\u05dd \u05d7\u05dc\u05d5\u05dd \u2728, \n\u05e2\u05dd \u05d7\u05dc\u05d5\u05dd \u05e9\u05d4\u05e1\u05ea\u05e4\u05e7\u05ea\u05d9 \u05de\u05d0\u05d5\u05d3 \u05dc\u05d2\u05d1\u05d9\u05d5 , \u05dc\u05d0 \u05d7\u05e9\u05d1\u05ea\u05d9 \u05e9\u05d0\u05e0\u05d9 \u05d0\u05d5\u05db\u05dc \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05db\u05dc \u05db\u05da \u05d4\u05e8\u05d1\u05d4 \u05d0\u05e0\u05e9\u05d9\u05dd ,\u05d5\u05dc\u05e8\u05d2\u05e9 \u05dc\u05d0 \u05de\u05e2\u05d8 , \u05d5\u05e2\u05d5\u05d3 \u05dc\u05d7\u05e9\u05d5\u05d1 \u05e8\u05d2\u05e2 \u05d5\u05dc\u05d3\u05e2\u05ea \u05e9\u05d6\u05d5 \u05e8\u05e7 \u05d4\u05d4\u05ea\u05d7\u05dc\u05d4 \u05d0\u05d5 \u05d0\u05e4\u05e9\u05e8 \u05dc\u05e7\u05e8\u05d5\u05d0 \u05dc\u05d6\u05d4 \u05d4\u05e7\u05d3\u05de\u05d4 ,  \u05de\u05e8\u05d2\u05e9 \u05d0\u05d5\u05ea\u05d9 \ud83d\ude4f\n\u05de\u05d7\u05e7\u05ea\u05d9 \u05d0\u05ea \u05d4\u05e9\u05d9\u05e8 \u05de\u05d9\u05d5\u05d8\u05d9\u05d5\u05d1 \u05db\u05d9 \u05d4\u05d7\u05dc\u05d8\u05ea\u05d9 \u05dc\u05e6\u05e2\u05d5\u05d3 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d4 \u05e2\u05dd \u05db\u05ea\u05d5\u05d1\u05ea , \u05dc\u05e2\u05d1\u05e8 \u05d7\u05dc\u05d5\u05dd \u05e2\u05dd \u05de\u05e9\u05de\u05e2\u05d5\u05ea \ud83c\udfaf \n\u05d7\u05d5\u05e0\u05db\u05ea\u05d9 \u05d1\u05d3\u05e8\u05da \u05d7\u05d9\u05d9\u05dd \u05de\u05e1\u05d5\u05d9\u05d9\u05de\u05ea .\n\u05d5\u05d4\u05de\u05d7\u05d5\u05d9\u05d1\u05d5\u05ea \u05e9\u05dc \u05d4\u05d9\u05d0 \u05dc\u05e0\u05ea\u05d1 \u05d0\u05ea \u05db\u05dc \u05d4\u05d7\u05dc\u05d5\u05de\u05d5\u05ea \u05e9\u05dc\u05d9 \u05d5\u05d0\u05ea \u05db\u05dc \u05d4\u05d7\u05d9\u05d9\u05dd \u05e9\u05dc\u05d9 \u05d1\u05d3\u05e8\u05da \u05d4\u05d6\u05d0\u05ea . \ud83d\udcdd\ud83d\udd2f\n\n\u05d4\u05e9\u05d9\u05e8 \u05d4\u05d6\u05d4 \u05d4\u05d2\u05d9\u05e2 \u05dc 43k  \u05e6\u05e4\u05d9\u05d5\u05ea .\n\u05e9\u05de\u05d7\u05ea\u05d9 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05db\u05dc \u05db\u05da \u05d4\u05e8\u05d1\u05d4 \u05d0\u05e0\u05e9\u05d9\u05dd ,\u05d5\u05d0\u05e0\u05d9 \u05db\u05dc \u05db\u05da \u05e9\u05dc\u05dd \u05e2\u05dd \u05d4\u05d4\u05d7\u05dc\u05d8\u05d4 \u05d4\u05d6\u05d0\u05ea . \n\u05de\u05d5\u05d3\u05d4 \u05dc\u05db\u05dd \u05de\u05e2\u05d5\u05de\u05e7 \u05dc\u05d9\u05d1\u05d9 \u05e2\u05dc \u05d4\u05ea\u05de\u05d9\u05db\u05d4 \u05d4\u05de\u05d3\u05d4\u05d9\u05de\u05d4 \u05e9\u05dc\u05db\u05dd .\n\u05d0\u05d5\u05d4\u05d1 \ud83e\udd0d\u2728\n\n\u05d6\u05d4 \u05e9\u05dc\u05db\u05dd \ud83d\udc95 \n\u05e7\u05d0\u05d1\u05e8 \"\u05e9\u05e0\u05d9 \u05d9\u05dc\u05d3\u05d9\u05dd \u05d1\u05e2\u05d5\u05dc\u05dd\" \n\u05e2\u05d9\u05d1\u05d5\u05d3 \u05d5\u05d4\u05e4\u05e7\u05d4 :\u05dc\u05d9\u05d3\u05d5\u05e8 \u05ea\u05d5\u05e8\u05d2'\u05de\u05df .\n\n\u05ea\u05d4\u05e0\u05d5 \ud83e\udd0d\n#\u05d4\u05d5\u05e4\u05e2\u05d4 #\u05dc\u05d4\u05e7\u05d4 #\u05e9\u05d9\u05e8\u05d9\u05dd #\u05d0\u05dc\u05d1\u05d5\u05dd #\u05d9\u05e6\u05d9\u05e8\u05d4 #\u05d6\u05de\u05e8 #\u05d4\u05e9\u05e7\u05d4 #\u05db\u05ea\u05d9\u05d1\u05d4 #\u05de\u05d5\u05d6\u05d9\u05e7\u05d4 #\u05de\u05d5\u05e1\u05d9\u05e7\u05d4  #music #musician #singer #singersongwriter #musicforthesoul"}}]},"shortcode":"Cc1QusPKl1Z","edge_media_to_comment":{"count":70},"taken_at_timestamp":1651014836,"dimensions":{"height":1167,"width":750},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/279219037_704890860703073_5824080439172997310_n.jpg?stp=dst-jpg_e15\u0026_nc_ht=instagram.flos1-