isto en los \u00faltimos a\u00f1os. \n\n\u00bfLes emociona ver al Madrile\u00f1o en vivo?\n\n\u2063\n\u2063\n#Ctangana #Pucho #trap #music #hiphop #elmadrile\u00f1o #sincantarniafinartour22 #reggaeton #dancehall #rap #dance #reggae #dembow #fuego #latino #traplatino #musicaurbana #hiphop  #musicalatina #latinmusic #frankreyesogazon #musicnews #noticiasdemusica"}}]},"shortcode":"Cf4KOwerT73","edge_media_to_comment":{"count":5},"taken_at_timestamp":1657554333,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293018795_584143583083686_1240786851719141962_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=ILyuVtWu15QAX-KPgWJ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_CF32Wmj2QTgPgZBSCVjvpXF4kD4UGvrSBsu18ZTzSRg\u0026oe=62D2DA18\u0026_nc_sid=4efc9f","edge_liked_by":{"count":127},"edge_media_preview_like":{"count":-1},"owner":{"id":"189205196"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293018795_584143583083686_1240786851719141962_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=ILyuVtWu15QAX-KPgWJ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8BtNUZ8cH6xQCep-XLiCucjID95PcFgpkGnrCVbZ_Wvg\u0026oe=62D2DA18\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293018795_584143583083686_1240786851719141962_n.jpg?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=ILyuVtWu15QAX-KPgWJ\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-KGuyWTDBOxHZ_ML-bzgUW2CkvIMNiRpMVFK08BfBsyQ\u0026oe=62D2DA18\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293018795_584143583083686_1240786851719141962_n.jpg?stp=dst-jpg_e35_s240x240\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=ILyuVtWu15QAX-KPgW