0_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=w0-ClTm0bGkAX_rwPp5\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-M35mGQjkPKSuaITYtayfx4iipIvOaY1VBZgFTYhk_ag\u0026oe=62D36F55\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292766001_728551671586166_8856026616687118200_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=w0-ClTm0bGkAX_rwPp5\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8QDQZYPr-NAYsnhBZucLCDCOv8UD82n8Mh1aBMwM60cA\u0026oe=62D36F55\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"__typename":"GraphSidecar","id":"2880095067617733408","edge_media_to_caption":{"edges":[{"node":{"text":"NEED IT\ud83d\udd25 o KEEP IT\ud83d\uddd1 \nScorri per ascoltare \ud83d\udc49\n\n\u00c8 l\u2019Era della \u201csample-drill\u201d.\nDa mesi ormai i produttori da tutto il pianeta \ud83c\udf0d stanno rispolverando gli archivi \ud83d\uddc3 dei capolavori della musica mondiale (specialmente quelli di inizio anni 2000) rivisitandoli e risuonandoli in chiave attuale. \n\nOltre a creare delle tracce immediatamente orecchiabili e potenzialmente virali, il campionamento permette anche ai fan pi\u00f9 giovani degli artisti di riscoprire delle tracce del passato, di cui altrimenti non sarebbero probabilmente mai venuti a conoscenza \ud83d\udcda\n\nA tal proposito @valepain (fresco fresco di maturit\u00e0 appena conseguita) ha annunciato oggi l\u2019arrivo di un suo nuovo singolo prodotto da @nkodrumz, la cui base prende ispirazione da \u201cBeautiful Girl\u201d \ud83d\udcc0\n\nPer chi non lo sapesse si tratta di una traccia di @seankingston pubblicata nel 2007.\nNel video Vale sembra riprendere e citare anche l\u2019immaginario che era stato usato dall\u2019artista giamaicano \ud83c\uddef\ud83c\uddf2 nel video ufficiale. \n\nLa traccia di Kingston, a sua volta, conteneva un campionamento di \u201cStand By Me\u201d del cantautore statunitense Ben King (1961). \n\nCosa ne pensate della \u201csample drill\u201d?\nParliamone nei commenti. \n\n\u27a1\ufe0f Per altri contenuti: @trapitaly \n#rap #hiphop #music #rapper #trap #rapmusic #newmusic #artist #producer #hiphopmusic #rappers #freestyle #spotify #trapmusic #follow #hiphopculture #musicproducer #musician #trapstar #trapitaly"}}]},"shortcode":"Cf4JzRgtasg","edge_media_to_comment":{"count":81},"taken_at_timestamp":1657554108,"dimensions":{"height":1347,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293358689_570441071187751_153175755827237124_n.jpg?stp=dst-jpg_e35_p1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=VK0nB9XSrKYAX9hHCsT\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8aG5ZuQVOiuWYv5bJEufp6SqOHO4EUZ31PA4cJw3JiOA\u0026oe=62D2D589\u0026_nc_sid=4efc9f","edge_liked_by":{"count":4000},"edge_media_preview_like":{"count":4000},"owner":{"id":"2995727527"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293358689_570441071187751_153175755827237124_n.jpg?stp=c0.178.1440.1440a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=VK0nB9XSrKYAX9hHCsT\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-9INIzruaumJK7VkTm2Wqi3VyEv3RuMa8_Drlf5noExw\u0026oe=62D2D589\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/293358689_570441071187751_153175755827237124_n.jpg?stp=c0.178.1440.1440a_dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=1\u0026_nc_ohc=VK0nB9XSrKYAX9hHCsT\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_4DZJ2VzYgF_lnWhLvO9Gk22DoqL3CDEG2gVkf4VjGDg\u0026oe=62D2D589\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/